tables.table_schema:
CREATE TABLE agents (
  agent_id SERIAL PRIMARY KEY,
  agent_name VARCHAR(50) NOT NULL,
  agent_email VARCHAR(100) NOT NULL
);

CREATE TABLE insurance_agents (
	agent_id INT PRIMARY KEY,
	agent_name TEXT,
	agent_email TEXT,
	agent_phone TEXT
);

CREATE TABLE members (
	member_id INT PRIMARY KEY,
	member_name TEXT,
	member_email TEXT,
	member_phone TEXT
);

CREATE TABLE healthcare_providers (
	healthcare_provider_id INT PRIMARY KEY,
	healthcare_provider_name TEXT,
	healthcare_provider_email TEXT,
	healthcare_provider_phone TEXT
);
